import './App.css';
import Footer from "./components/Footer/Footer";
import {Route, Routes} from "react-router-dom";
import Mainpage from "./components/MainPage/Mainpage";
import Centre from "./components/Centre/Centre";
import Documents from "./components/Documents/Documents";
import Login from "./components/Login/login";
import News from "./components/News/News";
import Adminnews from "./components/AdminNews/Adminnews";
import Editnews from "./components/EditNews/Editnews";
import {useState} from "react";
import Registration from "./components/Registration/Registration";


const ProtectedRoute = ({ user, children }) => {
    if (!user) {
        return <Navigate to="/landing" replace />;
    }

    return children;
};


function App() {

    const counterState = useState()
    console.log(counterState);
    return (
        <div className='app-wrapper'>
            <Routes>
                <Route exact path="/" element={<Mainpage/>}/>
                <Route exact path="/centre" element={<Centre/>}/>
                <Route exact path="/documents" element={<Documents/>}/>
                <Route exact path="/login" element={<Login/>}/>
                <Route exact path="/news" element={<News/>}/>
                <Route exact path="/adminnews" element={<Adminnews/>}/>
                <Route exact path="/edit" element={<Editnews/>}/>
            </Routes>
            <Footer/>
        </div>
    )
}

export default App;
